import testImage1 from "../../../img/testImage1.png";
import testImage2 from "../../../img/testImage2.png";
import testImage3 from "../../../img/testImage3.png";
import content from "../../../../Content/content.js";


export const CARD = [
    {
        key: "test1",
        img: testImage1,
        header: content.home.caseStudies.test1Header,
        alt: "First test image alternative"
    },
    {
        key: "test2",
        img: testImage2,
        header: content.home.caseStudies.test2Header,
        alt: "Second test image alternative"
    },
    {
        key: "test3",
        img: testImage3,
        header: content.home.caseStudies.test3Header,
        alt: "First test image alternative"
    }
];
